description:
&lt;p&gt;Deep beneath California, the Pacific and North American Plates relentlessly grind past one another, straining or &quot;loading&quot; faults in the Earth's rigid crust above. The horizontal (&quot;strike-slip&quot;) movement between these plates along the San Andreas Fault Zone is about 1.7 inches per year (40 mm/year), about as fast as your fingernails grow. At this rate, Los Angeles will be west of San Francisco in about 12 million years. &lt;/br&gt;
For more information: &lt;a href=&quot;http://pubs.usgs.gov/gip/dynamic/dynamic.html&quot;&gt;This Dynamic Earth&lt;/a&gt;
&lt;/p&gt;
